import React, { useState } from 'react';
import { View, Text, TextInput, TouchableOpacity, StyleSheet, Alert } from 'react-native';
import axios from 'axios';

const SignUp2 = ({onStepChange}) => {

  const [phoneNumber, setPhoneNumber] = useState('');
  const [country, setCountry] = useState('');
  const [city, setCity] = useState('');
  const [street, setStreet] = useState('');
  const [streetNum, setStreetNum] = useState('');
  const [entrance, setEntrance] = useState('');
  const [houseNumber, setHouseNumber] = useState('');
  const [dob, setDob] = useState('');

    // State for error messages
    const [error, setError] = useState('');


    const validateForm = () => {
      
      setError('');
      
      if (!phoneNumber) {
        setError('All fields are required');
        return false;
      }

      // if (!phoneNumber || !country || !city || !street || !streetNum || !entrance || !houseNumber || !dob) {
      //   setError('All fields are required');
      //   return false;
      // }
    
      // Add more sophisticated validation logic if needed
    
      return true;
    };


    // Function to handle sign-up action
  //   const handleSignUp2 = () => {
  //     if (validateForm()) {
  //         //Navigate to SignUp3 when the form is valid
  //         navigation.navigate('SignUp3',{phoneNumber});
  //         // navigation.navigate('SignUp3',{phoneNumber,country,city,street, streetNum,entrance,houseNumber,dob});
  //     }
  // };

  const handleSignUp = (newStep) => {
    if (validateForm()) {
      onStepChange(newStep);// Call the callback to move to the next step
    }
}
  
  return (
    <View style={styles.container}>
      <Text style={styles.title}>Sign Up - Step 2</Text>

      <TextInput
        style={styles.input}
        placeholder="Phone Number"
        onChangeText={(text) => setPhoneNumber(text)}
        value={phoneNumber}
        keyboardType="phone-pad"
      />

      <Text style={styles.subtitle}>Exact Residential Address:</Text>

      <TextInput
        style={styles.input}
        placeholder="Country"
        onChangeText={(text) => setCountry(text)}
        value={country}
      />

      <TextInput
        style={styles.input}
        placeholder="City"
        onChangeText={(text) => setCity(text)}
        value={city}
      />

      <TextInput
        style={styles.input}
        placeholder="Street"
        onChangeText={(text) => setStreet(text)}
        value={street}
      />

      <TextInput
        style={styles.input}
        placeholder="Street Number"
        onChangeText={(text) => setStreetNum(text)}
        value={streetNum}
      />

      <TextInput
        style={styles.input}
        placeholder="Entrance"
        onChangeText={(text) => setEntrance(text)}
        value={entrance}
      />

      <TextInput
        style={styles.input}
        placeholder="House Number"
        onChangeText={(text) => setHouseNumber(text)}
        value={houseNumber}
      />

      <TextInput
        style={styles.input}
        placeholder="Date of Birth (YYYY-MM-DD)"
        onChangeText={(text) => setDob(text)}
        value={dob}
        keyboardType="numeric"
      />

      {/* Display error message if there is one */}
      {error ? <Text style={styles.error}>{error}</Text> : null}

      <View style={styles.buttonContainer}>
          <TouchableOpacity style={styles.buttonPrev} onPress={() =>onStepChange(1)}>
          <Text style={styles.buttonText}>Prev</Text>
          </TouchableOpacity>
           <TouchableOpacity style={styles.buttonNext} onPress={() =>handleSignUp(3)}>
          <Text style={styles.buttonText}>Next</Text>
          </TouchableOpacity> 
      </View>

    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 20,
  },
  subtitle: {
    fontSize: 18,
    fontWeight: 'bold',
    marginTop: 10,
  },
  input: {
    width: '80%',
    height: 40,
    borderColor: 'gray',
    borderWidth: 1,
    marginBottom: 10,
    paddingLeft: 10,
  },
  error: {
    color: 'red',
    marginBottom: 10,
},
  button: {
    backgroundColor: 'blue',
    padding: 10,
    borderRadius: 5,
    marginTop: 10,
  },
  buttonText: {
    color: 'white',
    fontWeight: 'bold',
    textAlign: 'center',
  },
  buttonContainer: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    width: '80%',
    marginTop: 20,
  },
  buttonPrev: {
    backgroundColor: '#ccc', // Light gray
    padding: 10,
    borderRadius: 5,
    flex: 1,
    marginRight: 10,
  },
  buttonNext: {
    backgroundColor: 'blue',
    padding: 10,
    borderRadius: 5,
    flex: 1,
  },
});

export default SignUp2;
